import React from "react";
import Slider from "react-slick";
import Image from "next/image";
import { Wrap } from "../styles/Slider";

function SampleNextArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: "block", background: "red" }}
        onClick={onClick}
      />
    );
  }

  function SamplePrevArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: "block", background: "green" }}
        onClick={onClick}
      />
    );
  }


export default function SimpleSlider() {
  var settings = {
    dots: true,
    fade: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />
  };
  return (
    <Wrap>
      <Slider {...settings}>
        <div>
          <Image src="/melodrom-1.jpg" width={450} height={350} />
        </div>
        <div>
          <Image src="/melodrom-2.jpg" width={450} height={350} />
        </div>
        <div>
          <Image src="/melodrom-3.jpg" width={450} height={350} />
        </div>
        <div>
          <Image src="/melodrom-4.jpg" width={450} height={350} />
        </div>
        <div>
          <Image src="/melodrom-5.jpg" width={450} height={350} />
        </div>
      </Slider>
    </Wrap>
  );
}
